import logo from './logo.svg';
import './App.css';
import React, {useState, useEffect} from 'react';

function App() {
  const [message, setMessage]=useState([]);
  useEffect(()=>{
    fetch("/helloStr")
        .then((res)=>{
		  console.log("res", res);
          return res.json();
        })
        .then((data)=>{
		  console.log("data", data);
          setMessage(data);
        });
  },[]);
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <ul>
        	{message.map((v,idx)=>console.log(v,idx))}{message.map((v,idx)=><li key={`${idx}-${v}`}>{v}</li>)}
        </ul>
      </header>
    </div>
  );
}

export default App;
